  `effect_trans_guage` int(11) DEFAULT 0 COMMENT 'Amount of additional transformation guage given',
  `effect_critical` int(11) DEFAULT 0 COMMENT 'Amount of additional critical attack points',
  `effect_evade` int(11) DEFAULT 0 COMMENT 'Amount of additional evade points given',
  `effect_special_trans` int(11) DEFAULT 0 COMMENT 'Amount of additional special transformation points',
  `effect_speed` int(11) DEFAULT 0 COMMENT 'Amount of additional speed points given',
  `effect_trans_bot_defense` int(11) DEFAULT 0 COMMENT 'Amount of additional transformation bot defense points given',
  `effect_trans_bot_attack` int(11) DEFAULT 0 COMMENT 'Amount of additional transformation bot attack points given',
  `effect_trans_speed` int(11) DEFAULT 0 COMMENT 'Amount of additional transformation speed given',
  `effect_ranged_attack` int(11) DEFAULT 0 COMMENT 'Amount of additional ranged attack points given',
  `effect_luck` int(11) DEFAULT 0 COMMENT 'Amount of additional luck points given',
  PRIMARY KEY (`id`),
  UNIQUE KEY `item_id` (`item_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2082 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

